import AspectRatio from '@mui/joy/AspectRatio';


function Slider() {
  return (
    <AspectRatio variant="outlined" ratio="1" objectFit="cover">
      {/* only layout="fill" makes sense for using with AspectRatio */}
      <img alt="Mountains" src="https://avatars.dzeninfra.ru/get-zen_doc/3964212/pub_62209ab1c02b7725797de91a_6220e51d27ff833e1e0f5646/scale_1200" layout="fill" placeholder="blur" />
    </AspectRatio>
  );
}

export default Slider;
